import MSFTCarousel, { CarouselSlideTheme, } from "./carousel";
import carouselSchema from "./carousel.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { CarouselStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Carousel = manageJss(CarouselStyles)(MSFTCarousel);
export { Carousel, carouselSchema, CarouselSlideTheme, };
